import React, { Component } from 'react';
import Name from './Name';
import Game from './Game';
import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    this.state={
      NamePage:[],
      GameScreen:[]
    }
  }
  componentWillMount(){
    let NamePage =[];
    NamePage.push(<Name appContext={this}/>);
    this.setState({
                  NamePage:NamePage
                    })
  }
  render() {
    return (
      <div className="App">
        {this.state.NamePage}
        {this.state.GameScreen}
      </div>
    );
  }
}


export default App;
